import numpy as np

def dissect_matrix(C):
    """"""
    C = np.array(C)
    if np.any(np.all(C == 0, axis=1)) or np.any(np.all(C[:, 1:] == C[:, :-1], axis=0)):
        det = 0
    else:
        det = np.linalg.det(C)
        if abs(det) < 1e-06:
            det = 0
    rank = np.linalg.matrix_rank(C)
    return (det, rank)
